def get_sign(data):
    data_sorted = sorted(data.items(), key=lambda d: d[0])
    new_s = ''.join(['{}={}&'.format(k, v) for k, v in data_sorted]) + "key=apr1$AwP!wRRT$gJ/q.X24poeBInlUJC"
    print("new_s : ", new_s)
    return hashlib.md5(new_s.encode("utf-8")).hexdigest()


def get_device_id():
    new_s = "A4V7TrkQiMlOuqTYqwABZehA8d4gsVW6"
